export default function SoundingImages({ containerClass, textClass, iframeWrapperClass, iframeClass }) {
    return (
        <div className={containerClass}>
            {/* Text section (1/3 width) */}
            <div className={textClass}>
                <h2 className="text-2xl font-bold pb-8">Sounding Images & Percussion</h2>
                <p>
                    Performance from{" "}
                    <a 
                        href="https://genbib.dk/tranen" 
                        target="_blank" 
                        rel="noopener noreferrer"
                        className="text-blue-600 underline"
                    >
                        Tranen, Gentofte Hovedbibliotek
                    </a>, March 31, 2019. I am performing on an iPad, showcasing my iOS app Sounding Images #7-12 in an improvisatory interplay with Ying-Hsueh Chen on her acoustic percussion instruments. We perform regularly with this setup at various venues.
                </p>
            </div>

            {/* Responsive iframe wrapper */}
            <div className={`${iframeWrapperClass} relative`} style={{ paddingTop: "56.25%" }}>
                <iframe 
                    className={`${iframeClass} absolute top-0 left-0 w-full h-full`} 
                    src="https://www.youtube.com/embed/Ehx0cWi_bbY?si=x9CmG4wnzqygTSOH" 
                    title="Artwork Video" 
                    allowFullScreen
                ></iframe>
            </div>
        </div>
    );
}

